const Main = () => {
    const onClickButtonNavigate = (event) => {
        const problemNum = event.target.name;
        console.log(problemNum);
    };
    return (
        <>
            <button name="2" onClick={onClickButtonNavigate}>
                문제 2번
            </button>
            <button name="3">문제 3번</button>
            <button name="4">문제 4번</button>
        </>
    );
};

export default Main;
